import React from 'react';
import styles from './SkillBadge.module.css';

 SkillBadge = () => {
  return (
    <div className={styles.badge}>
      <Header />
      <ProfileInfo />
      <BadgesList />
    </div>
  );
};

export default SkillBadge;
